import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './components/NavBar';
import UploadActivities from './components/UploadActivities';
import Stats from './components/Stats';
import ActivityHistory from './components/ActivityHistory';

<img 
  src="your-image-url.jpg" 
  alt="Running Banner" 
  style={{ width: '100%', height: '200px', objectFit: 'cover' }} 
/>

function App() {
  return (
    <Router>
            <NavBar />

      {/* Main Dashboard Banner Image */}
      <div style={{
        backgroundImage: 'url(https://example.com/your-image.jpg)', 
        backgroundSize: 'cover', 
        height: '400px', 
        display: 'flex', 
        justifyContent: 'center', 
        alignItems: 'center',
      }}>
        <h1 style={{ color: '#FFF' }}>Welcome to RunningOnData Dashboard</h1>
      </div>
      <Routes>
        <Route path="/upload" element={<UploadActivities />} />
        <Route path="/stats" element={<Stats />} />
        <Route path="/history" element={<ActivityHistory />} />
      </Routes>
    </Router>
  );
}

export default App;













